pragma solidity >=0.6.0 <0.9.0;

import "./Token.sol";

contract dBank {

  //assign `Token` contract to variable
  Token private token;

  //add mappings
  mapping(address => uint) public etherBalanceOf;
  mapping(address => uint) public depositStart;
  mapping(address => bool) public isDeposited;

  //add events
  event Deposit(address indexed user, uint etherAmount, uint timeStart);
  event Withdraw(address indexed user, uint etherAmount, uint depositStart, uint interest);

  //pass as constructor argument deployed Token contract
  constructor(Token _token) {
    //assign token deployed contract to variable
    token = _token;
  }

  function deposit() payable public {
    //check if msg.sender didn't already deposited funds
    require(isDeposited[msg.sender] == false, 'ERROR, Deposit already active or completed');

    //check if msg.value is >= than 0.01 ETH
    require(msg.value >= 1e16, 'ERROR, Deposit must be >= 0.01 ETH');   // 1e16 == 10000000000000000

    //increase msg.sender ether deposit balance
    etherBalanceOf[msg.sender] = etherBalanceOf[msg.sender] + msg.value;

    //start msg.sender hodling time
    depositStart[msg.sender] = depositStart[msg.sender] + block.timestamp;
    
    //set msg.sender deposit status to true
    isDeposited[msg.sender] = true;   // activate deposit status

    //emit Deposit event
    emit Deposit(msg.sender, msg.value, block.timestamp);
  }

  function withdraw() payable public {
    //check if msg.sender deposit status is true
    require(isDeposited[msg.sender] == true, 'ERROR, No previoud deposits');

    //assign msg.sender ether deposit balance to variable for event
    uint userBalance = etherBalanceOf[msg.sender];  // For Event

    //check user's hodl time
    uint depositTime = block.timestamp - depositStart[msg.sender];

    //calc interest per second
    uint interestPerSecond = 31668017 * (etherBalanceOf[msg.sender] / 1e16);

    //calc accrued interest
    uint interest = interestPerSecond * depositTime;

    //send eth to user
    payable(msg.sender).transfer(userBalance);

    //send interest in tokens to user
    token.mint(msg.sender, interest);  //interest to user

    //reset depositer data
    etherBalanceOf[msg.sender] = 0;
    depositStart[msg.sender] = 0;
    isDeposited[msg.sender] = false;

    //emit event
    emit Withdraw(msg.sender, userBalance, depositTime, interest);
  }

